char *convertData(char *src, int src_length)
{
    const char newChar = '.';
 
    for (int i = 0; i < (src_length-1); i++)
    {
        if (isalnum(src[i]))
        {
            src[i] = toupper(src[i]);        
        }
        else
        {
            src[i] = newChar;
        }
    }

    cout << endl << src << endl << endl;

    return src;

}

